&#60;h1&#62;Datos del formulario&#60;/h1&#62;&#60;h2&#62;FORMULARIO DOCENTE&#60;/h2&#62;&#60;div&#62;&#60;b&#62;1) Seleccione su requerimiento: : &#60;/b&#62;Calificaciones&#60;/div&#62;&#60;div&#62;&#60;b&#62;2) Describa su requerimiento: : &#60;/b&#62;&#60;p&#62;Buenas tardes, por dar a conocer dos novedades que detecto al momento de asentar las notas de la materia de MIC DEL ÁREA DE FILOSOFÍA.&#60;/p&#62;
&#60;p&#62;1) Los porcentajes asignados a cada uno de los parciales están: 35% 1er parcial, 35% 2do parcial y 30% Examen final; cuando se indicó que para este periodo la materia se ejecutaría en 3 parciales con porcentajes equitativos, es decir, 33,34%, 33,33% y 33,33% respectivamente.&#60;/p&#62;
&#60;p&#62;2) Otra novedad es que al asentar las notas sale que el plazo para asentar las notas del 2do parcial es hasta el 26 de febrero, lo cual es un error, pues con el aplazamiento que se autorizó, el pazo vence el 25 de enero de 2023.&#60;/p&#62;
&#60;p&#62;3) No hay como asentar las inasistencias de los estudiantes, tampoco registrar las asistencias a las TUTORIAS de los estudiantes en la materia de MIC. &#60;/p&#62;&#60;/div&#62;&#60;div&#62;&#60;b&#62;3) Adjunte Documentos : &#60;/b&#62;Documento adjunto&#60;/div&#62;

