&#60;h1&#62;Datos del formulario&#60;/h1&#62;&#60;h2&#62;FORMULARIO DOCENTE&#60;/h2&#62;&#60;div&#62;&#60;b&#62;1) Seleccione su requerimiento: : &#60;/b&#62;&#60;/div&#62;&#60;div&#62;&#60;b&#62;2) Describa su requerimiento: : &#60;/b&#62;&#60;p dir="ltr"&#62;Saludos,&#60;/p&#62;
&#60;p dir="ltr"&#62;Al parecer el sistema de tutorías de MiESPE tiene deshabilitado el reporte de asistencia a tutorías de reforzamiento (MiESPE&#38;gt;Docente&#38;gt;Tutorias&#38;gt;Registro de Tutorias&#38;gt;Asistencias). En varias ocasiones he planificado tutorías de reforzamiento, y durante la tutoría he registrado los alumnos asistentes. Sin embargo, el sistema solo muestra el Historial de tutorías (ver figura adjunta) pero no es posible ver los alumnos que fueron registrados oportunamente (ver figura adjunta). &#60;/p&#62;
&#60;p dir="ltr"&#62;Ya que se necesita esta informacion para evidenciar la actividad docente, solicito su ayuda para obtener el listado de asistentes a las tres tutorías que listo a continuación.&#60;/p&#62;
&#60;p dir="ltr"&#62;(1) NRC: 10222, ASIGNATURA: SOC PARA TELECOMUNICACIONES, RANGO APROXIMADO: 12:00 PM - 2:00 PM, FECHA: 24-01-2023&#60;br&#62;(2) NRC: 10552, ASIGNATURA: DISEÑO VLSI, RANGO APROXIMADO: 2:00 PM - 3:00 PM, FECHA: 12-01-2023&#60;br&#62;(3) NRC: 9975, ASIGNATURA: SISTEMAS EMBEBIDOS, RANGO APROXIMADO: 3:00 PM - 5:00 PM, 12-01-2023&#60;/p&#62;
&#60;p dir="ltr"&#62;Como Coordinador de Área, algunos docentes también me han informado de este comportamiento. Por lo tanto, quizá sea algo que se deba revisar para toda la universidad.&#60;/p&#62;
&#60;p dir="ltr"&#62; &#60;/p&#62;
&#60;p dir="ltr"&#62;Atentamente,&#60;br&#62;Byron Navas&#60;br&#62;DEEL&#60;/p&#62;
